import React from 'react';
import { Carousel } from 'react-bootstrap';
import ReactDOM from 'react-dom';

//const rightArrowSlide = document.getElementById('name').value;



export default function CarouselOfProjects(){

	const rightArrowRef = React.createRef() as React.MutableRefObject<HTMLInputElement>;
	const leftArrowRef = React.createRef() as React.MutableRefObject<HTMLInputElement>;


	function emitSlideOnWheel(event: React.WheelEvent){
		(event.deltaY/100>0) ?  console.log('+') : console.log(event.deltaY);
		//console.log(event);
		rightArrowRef.current.click();
	}

	const style ={
		inlineFlex:{
			display:'table-row-group',
		},
		zIndex10:{
			transform: 'translate(-0%,0%)',
			zIndex:1,
		},
	};
	return(
		<div className="NetworkOfProjects_div">
			<Carousel nextIcon={<span ref={rightArrowRef} aria-hidden="true" className="carousel-control-next-icon"/>}
				prevIcon={<span ref={leftArrowRef} aria-hidden="true" className="carousel-control-prev-icon"/>}
				interval={15000} 
				style={style.inlineFlex} 
				onSlide={()=>console.log('ttteesstt')}>
				
				<Carousel.Item>
					<img
						className="d-block w-100"
						src="./imgs/newspaper.png"
						alt="First slide"
					/>
					<img onWheel={ emitSlideOnWheel }
						className="d-block w-100 foreground"
						src="./imgs/newspaperForeground.png"
						alt="First slide"
					/>

					<Carousel.Caption style={style.zIndex10}>
						<h3>First slide label</h3>
						<p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
					</Carousel.Caption>
				</Carousel.Item>
				<Carousel.Item>
					<img
						className="d-block w-100"
						src="./imgs/newspaperForeground.png"
						alt="Second slide"
					/>

					<Carousel.Caption>
						<h3>Second slide label</h3>
						<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
					</Carousel.Caption>
				</Carousel.Item>
				<Carousel.Item>
					<img
						className="d-block w-100"
						src="./imgs/newspaper.png"
						alt="Third slide"
					/>

					<Carousel.Caption>
						<h3>Third slide label</h3>
						<p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
					</Carousel.Caption>
				</Carousel.Item>
			</Carousel>
		</div>
	);
}
